import React from "react";

// import "./index.css";

function App(){
    let crnDate = new Date(21,8,15, 16);
    crnDate = crnDate.getHours();
    let greeting = "";
    let cssStyle = {};

    if (crnDate >= 1 && crnDate < 11) {
        greeting = "Good Morning";
        cssStyle.color = "red";
    }else if(crnDate >= 12 && crnDate < 19){
        greeting = "Good Afternone";
        cssStyle.color = "green";
    }else{
        greeting = "Good Night";
        cssStyle.color = "yellow";

    }

    return(
        <>
       <h1>Hello, <span style = {cssStyle}>{greeting}</span>  </h1>
    </>
    );
    
}

export default App;
